from unittest import TestCase
from py_socket.cells import CertsPayload, unpack_certs_payload
import base64

class NetInfoPayloadTests(TestCase):
    def test_unpack(self):
        base64_payload = ''
        payload_buffer = base64.b64decode(base64_payload)
        unpack_certs_payload(payload_buffer)
        self.assertEqual(1, 1)
